// @mui material components
import Icon from "@mui/material/Icon";
import Tooltip from "@mui/material/Tooltip";

// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";
import SuiButton from "components/SuiButton";

// Soft UI Dashboard PRO React base styles
import borders from "assets/theme/base/borders";

// Images
import masterCardLogo from "assets/images/logos/mastercard.png";

function PaymentDetails() {
  const { borderWidth, borderColor } = borders;

  return (
    <>
      <SuiTypography variant="h6" fontWeight="medium">
        Payment detailscc
      </SuiTypography>
      <SuiBox
        border={`${borderWidth[1]} solid ${borderColor}`}
        borderRadius="lg"
        display="flex"
        justifyContent="space-between"
        alignItems="center"
        p={3}
        mt={2}
      >
        <SuiBox component="img" src={masterCardLogo} alt="master card" width="10%" mr={2} />
        <SuiTypography variant="h6" fontWeight="medium">
          ****&nbsp;&nbsp;****&nbsp;&nbsp;****&nbsp;&nbsp;7852
        </SuiTypography>
        <SuiBox ml="auto" lineHeight={0}>
          <Tooltip title="We do not store card details" placement="bottom">
            <SuiButton variant="outlined" buttonColor="secondary" size="small" iconOnly circular>
              <Icon className=" cursor-pointer">priority_high</Icon>
            </SuiButton>
          </Tooltip>
        </SuiBox>
      </SuiBox>
    </>
  );
}

export default PaymentDetails;
